import styled from "styled-components";

export const Container = styled.button`
  width: 100%;
  cursor: pointer;
  display: inline-block;
  text-align: center;
  background-color: var(--blue);
  line-height: 24px;
  border: 0;
  color: var(--white);
  font: 0.875rem;
  font-weight: 600;
  transition: 0.3s;
  padding: 12px 20px;
`
